  constructor(props){
    super(props);
  this.state={ 
    AddIteme:[]
  }}
  addItem = (e) => {
    e.preventDefault();
    console.log('Add Item!');
    this.setState({
      AddIteme: [...this.state.AddIteme, this.state.newItem],
      newItem: ''
    });
  }
  onTextBoxChange = (e) => {
    console.log('On Text Change', e.target.value);
    this.setState({
      newItem: e.target.value
    });
  }
render(){
  const {AddIteme}=this.state;
  return(
    <div>
      <form>
        <div className="Form">
          <label className="label">Add new Item</label>
          <input type="text" value={this.state.newItem}
                 onChange={this.onTextBoxChange}></input>
          <button onClick={this.addItem} type="submit" className="button">Add</button>
        </div>
      </form>  
</div>
  )}}
